import React from "react";
import "../Styles/Capabilities.css";
import capabilities_1 from "../Images/cap.jpeg";

function Capabilities() {
  return (
    <div className="capabilities">
      <div className="capabilities-text">
        <ul className="cpabilities-list">
          <li>Prototyping and Production</li>
          <li>Contract Manufacturing</li>
          <li>Product Development</li>
          <li>CNC Mill and Lathe</li>
          <li>Abrasive Waterjet Cutting 5 x 10</li>
          <li>2D / 3D CAD / CAM</li>
          <li>Conventional Machining (turning, milling, & surface grinding)</li>
          <li>Full Coordinate Measuring Machine (CMM) inspection</li>
          <li>TIG & MIG Welding</li>
          <li>2.5-ton crane and 2-ton forklift</li>
          <li>Near 280, 101 and Bay Bridge</li>
        </ul>
      </div>
      <div className="capabilities-image">
        <img src={capabilities_1}></img>
      </div>
    </div>
  );
}

export default Capabilities;
